import React from "react";
import Head from "next/head";
import Style from "../style/style";
import Footer from "../components/Footer";

class App extends React.Component {
  render() {
    return (
      <div>
        <html lang="ja" />
        <Head>
          <title>React</title>
          <meta charSet="utf-8" />
          <meta
            name="viewport"
            content="initial-scale=1.0,width=divice-width"
          />
        </Head>
        {Style}
        <div>
          <h1>目次</h1>
          <Footer go="./Page2" />
        </div>
      </div>
    );
  }
}

export default App;
